毎年、三条市の中浦ヒメサユリ森林公園で開催される入場無料野外音楽フェス「三条楽音祭」
今年は新型コロナウイルスの影響で開催が危ぶまれましたが、YouTubeでのオンライン配信で開催決定！
⠀
https://online.rakuonsai.com/
⠀
WESTではこの三条楽音祭を一緒に盛り上げる為、この度9/13当日の15時より配信されるオンラインステージの様子を、4店舗でパブリックビューイングします！
